import Header from '../components/header.js';
import Footer from '../components/footer.js';
import politicaimg from '../SURSE/logos/Untitled_logo_1_free-file.jpg';

function Politica(){
    return(
        <>
        <Header />
        <div className="w-full h-[400px] relative flex items-center justify-center pl-2 pr-2 md:pl-10 md:pr-10">
  <div className="bg-[#96ABAC] h-[300px] w-[90%] md:w-[950px] rounded-full relative flex items-center justify-center">
    <h3 className="w-[225px] text-center text-sm md:text-base">
      Informațiile prezentate mai jos se referă la politica site-ului.
    </h3>
    <img src={politicaimg} className="rounded-full scale-75" />
    <h3 className="w-[225px] text-center text-sm md:text-base">
      Aceste politici sunt create pentru a asigura o experiență sigură și consistentă pentru utilizatori, respectând norme de utilizare corectă a conținutului și interacțiunilor din cadrul platformei.
    </h3>
  </div>
</div>

        <Footer />
        </>
    );
}

export default Politica;
